import React from "react";

export default function Form() {
  return (
    <div>
      <div className="input-field">
        <input 
        min="1"
        max="100"
        id="inputInit" 
        type="number" 
        className="validate" />

        <label htmlFor="inputInit">First Name</label>
      </div>
    </div>
  );
}
